import {  StyleSheet, View } from 'react-native';

import AppDigitalWatch from '../watch/appDigitalWatch'


function WatchScreen() {
    return (
      <View >
      <AppWatch></AppWatch>
        <AppDigitalWatch></AppDigitalWatch>
      </View>
    );
  }

  
  export default WatchScreen;
